@font-face {
    font-family: 'Ahem';
    src: url('file:///Users/jane/Projects/Lambda/test/layout/data/css2.1/html4/support/ahem3.ttf') format('truetype');
    font-weight: normal;
    font-style: normal;
}

.container {
  margin: 1em;
  font: 20px/1 Ahem;
  border: solid silver;
  width: 4em;
  color: aqua;
  background: fuchsia;
}
.relpos {
  position: relative;
  color: yellow;
  left: 2em;
}
.block, .controlC {
  color: orange;
  background: orange;
  width: 2em;
  border-left: 2em solid blue;
}
.block {
  margin-left: -2em;
  height: 10px;
}

.float {
  width: 2em;
  height: 10px;
}
.float.L {
  float: left;
  background: orange;
  color: orange;
}
.float.R {
  float: right;
  background: blue;
  color: blue;
  /* Back position to fill the hole left by relpos'ing .float.L */
  position: relative;
  right: 4em;
}

.controlB {
  color: yellow;
}
.controlC {
  margin-left: 0;
}
